    "def analyze_sentiment(review, model, tokenizer):\n",
    "    review_sequence = tokenizer.texts_to_sequences([review])\n",
    "    review_padded = pad_sequences(review_sequence, maxlen=X.shape[1])\n",
    "    result = model.predict(review_padded)[0]\n",
    "    sentiment = np.argmax(result)\n",
    "    if sentiment == 0:\n",
    "        return \"Negative\"\n",
    "    elif sentiment == 1:\n",
    "        return \"Neutral\"\n",
    "    else:\n",
    "        return \"Positive\"\n",
    "new_review = input(\"enter the review:\")\n",
    "sentiment = analyze_sentiment(new_review, model, tokenizer)\n",
    "print(\"Sentiment:\", sentiment)"
