    "    review_sequence = loaded_tokenizer.texts_to_sequences([review])\n",
    "    review_padded = pad_sequences(review_sequence, maxlen=maxlen)\n",
    "    result = loaded_model.predict(review_padded)[0]\n",
    "    sentiment = np.argmax(result)\n",
    "    if sentiment == 0:\n",
    "        return \"Negative\"\n",
    "    elif sentiment == 1:\n",
    "        return \"Neutral\"\n",
    "    else:\n",
    "        return \"Positive\"\n",
